import Hero from './Hero';
import NavBar from './NavBar';


function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
          <Route path="/" />
          {/* <Route path="/doctors" element={Doctors} /> */}
          {/* <Route path="/forms" element={Forms} /> */}
